import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the sort filter visible, we first need to perform a search.
    // 1. Find the search input and type a query.
    const searchInputSelector = 'input#searchInput';
    await page.waitForSelector(searchInputSelector, { timeout: 5000 });
    await page.fill(searchInputSelector, 'electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // 2. Submit the search by pressing Enter.
    await page.press(searchInputSelector, 'Enter');

    // 3. Wait for the sort dropdown to appear on the results page.
    const sortSelectSelector = '#sortSelect';
    await page.waitForSelector(sortSelectSelector, { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Select the 'Price: Low to High' option.
    const sortValue = 'price-low';
    await page.selectOption(sortSelectSelector, sortValue);

    // 5. Verify the selection and take a final screenshot.
    const selectedValue = await page.inputValue(sortSelectSelector);
    if (selectedValue !== sortValue) {
      throw new Error(`Failed to select the correct sort option. Expected ${sortValue}, but got ${selectedValue}.`);
    }
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_price_sorted.png'));

    return {
      success: true,
      action: "Applied price sort filter (Low to High)",
      extractedData: {
        selectedSortOption: selectedValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, capture a final screenshot if possible
    const screenshotsOnFailure = [];
    try {
        const failureScreenshotPath = path.join(screenshotsDir, 'failure_screenshot.png');
        await page.screenshot({ path: failureScreenshotPath });
        screenshotsOnFailure.push(failureScreenshotPath);
    } catch (e) {
        // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: screenshotsOnFailure,
      error: error.message
    };
  }
}
